import React from 'react';
import './App.css';
import Header from "./header";
import Main from "./Main";
import Skills from "./Skills";
import Project from "./Project";

function App() {
  return (
    <div className="App">
      <div className="portfolio">
          <Header />
            <Main/>
            <Skills/>
            <Project/>
    </div>
    </div>

  );
}
export default App;
